const Galcard = ({cardItem}) => {
    console.log("cardItem" , cardItem);
    return (
       <>
            <div className="concard">
                <li><img src={cardItem.galWebImageUrl} /></li>
                <li>{cardItem.galTitle}</li>
                <li>{cardItem.gal}</li>
            </div>
       </>
    );
}

export default Galcard;
